import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { Search } from './inventory';

function Warehouse() {
	let [warehouse, setWarehouse] = useState();
	let id = useParams().id;

	useEffect(() => {
		fetch(`http://localhost:4000/warehouse/${id}`).then((res) => {
			res.json().then((data) => {
				console.log(data);
				setWarehouse(data);
			});
		});
	}, []);

	if (warehouse == null) {
		return <div>Loading...</div>;
	} else {
		return <Search name={warehouse.name} />;
	}
}

export default Warehouse;
